import React from 'react'
import Car1 from "./img/image8.jpeg"
import "./CarInstance.css"

interface Props {
  filepath: string,
  strMark: string,

}

const CarInstance = (props:Props) => {

  return (
    <div className="car-image-wrapper col-md-4 col-sm-6 col-12">
        <img src={props.filepath} alt={props.strMark} />
        <p className="car-name">{props.strMark}</p>
        <p className="car-price">{props.strPrice}$/day</p>
    </div>

  );
}

export default CarInstance;
